import React from 'react'
import Flowchart from './flowchart.png'


const Home = () => {

    return (
        <div style = {{textAlign: 'center', 
                        display: 'block', 
                        margin: 'auto', 
                        justifyContent: 'center',
                        paddingTop: '100px',
                        paddingBottom: '100px'}}>
            <img src = {Flowchart} alt="flowchart" height='700px'/>
        </div>
    )
}




export default Home;
